import React from 'react';


export default  function Test(){
    const Employees = [
        {
            name: "miroj",
            position: "CEO",
        },
        {
            name: "binamra",
            position : "Peon",
        },
        {
            name: "anish",
            position : "water boy",
        }
    ];
    return(
        <div className= "employees">
            <h1>Name of the employees of the company.</h1>
        {
            Employees.map((employee) => (<div>
                <h3>{`name : ${employee.name}`}</h3>
                <h5>{`position : ${employee.position}`}</h5>
            </div>))
        }
        </div>
    );
}
